import React, {Component} from "react";

class InformationSection extends Component {
    render () {
        return (
            <div className = "informationSection">
                <p className = "shoutout">Your first week is free!</p>
                <p> We are building a community of lasting friendships and self-growth through education and wellness. </p>

                <style jsx>{`
                    .informationSection {
                        background-size: cover;
                    }

                    .informationSection h1 {
                        font-family: Lato;
                        font-weight: 900;
                        margin:0;
                        text-align: center;
                        padding-top: 10px;
                        padding-bottom: 20px;   
                        vertical-align: middle;
                        font-size: 10vh;
                    }
                `}</style>
            </div>
        );
    }
}

export default InformationSection;
